import UIKit

protocol SearchByPresentationLogic
{
  func presentSomething(response: SearchBy.Something.Response)
}

class SearchByPresenter: SearchByPresentationLogic
{
  weak var viewController: SearchByDisplayLogic?
  
  // MARK: Do something
  
  func presentSomething(response: SearchBy.Something.Response)
  {
    let viewModel = SearchBy.Something.ViewModel()
    viewController?.displaySomething(viewModel: viewModel)
  }
}
